import { BrowserRouter, Route, Routes } from 'react-router-dom'
import Home from './components/home'
import Login from './components/login'
import Catalog from './components/catalog'
import './styles/App.css'
import { useEffect, useState } from 'react'
import Signup from "./components/signup";
import Homepage from "./components/home";
import AdoptionPage from "./components/adoption"
import AdoptionInfo from "./components/info";
import EditorCatalog from "./components/editor_catalog"


function App() {
  const [loggedIn, setLoggedIn] = useState(false)
  const [email, setEmail] = useState('')
  const [username, setUsername] = useState('')

  return (
      <div className="App">
        <BrowserRouter>
          <Routes>
            <Route
                path="/"
                element={<Home email={email} loggedIn={loggedIn} setLoggedIn={setLoggedIn} />}
            />
            <Route path="/login" element={<Login setLoggedIn={setLoggedIn} setEmail={setEmail} />} />
              <Route path="/signup" element={<Signup setLoggedIn={setLoggedIn} setUsername={setUsername} setEmail={setEmail} />} />
              <Route path="/catalog" element={<Catalog></Catalog>} />
              <Route path="/home" element={<Homepage></Homepage>} />
            <Route path="/adoption" element={<AdoptionPage></AdoptionPage>} />
            <Route path="/adoption-info" element={<AdoptionInfo></AdoptionInfo>} />
            <Route path="/editor-catalog" element={<EditorCatalog></EditorCatalog>} />
          </Routes>
        </BrowserRouter>
      </div>
  )
}

export default App
